import React from "react";

function PostPage() {

  return (
    <div>
       <p>This is the second page.</p>
       <TextField
        id="first-name"
        label="Name"
  value={this.state.name}
  onChange={this.handleChange('name')}
  margin="normal"
/>
        </div>
      );

  }

export default PostPage;
